	add("spoonerism", "{\"term\":\"spoonerism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Named after the w:William Archibald Spooner|Reverend W. A. Spooner (1844–1930), who is supposed to have habitually made such slip-ups.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A play on words on a phrase in which the initial (usually consonantal) sounds of two or more of the main words are transposed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027spoonerism\u0027\u0027 \u0026quot;The queer old dean\u0026quot; (instead of \u0026quot;the dear old Queen\u0026quot;) is attributed to Rev. Spooner\", \"priority\":2}]}, \"synonyms\":{}}");

	add("spoonful", "{\"term\":\"spoonful\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spoon|ful|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The amount that a spoon will hold, either level or heaped\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dBut Richmondappeared to lose himself in his own reflections. Some pickled crab, which he had not touched, had been removed with a damson pie; and his sister sawthat he had eaten no more than a \u0027\u0027spoonful\u0027\u0027 of that either\", \"priority\":2}]}, \"synonyms\":{}}");

	add("spork", "{\"term\":\"spork\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|spoon|fork|lang\u003den}}; originally a trademark\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An eating utensil shaped like a spoon, the bowl of which is divided into tines like those of a fork, and so has the function of both implements; some sporks have a serrated edge so they can also function as a knife\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sport", "{\"term\":\"sport\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|sporten|pos\u003dverb}} and {{m|enm|sport}}, {{m|enm|spoort}}, {{m|enm|sporte|pos\u003dnoun}}, apheretic shortenings of Middle english (1100-1500) {{m|enm|disporten|pos\u003dverb}} and {{m|enm|disport}}, {{m|enm|disporte|pos\u003dnoun}}. More at {{l/en|disport}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any activity that uses physical exertion or skills competitively under a set of rules that is not based on aesthetics\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who exhibits either good or bad sportsmanship\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Jen may have won, but she was sure a poor \u0027\u0027sport\u0027\u0027; she laughed at the loser\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The loser was a good \u0027\u0027sport\u0027\u0027, and congratulated Jen on her performance\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Somebody who behaves or reacts in an admirable manner, a good sport\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"You\u0027re such a \u0027\u0027sport\u0027\u0027! You never get upset when we tease you\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"That which diverts, and makes mirth; pastime; amusement\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Think it but a minute spent in \u0027\u0027sport\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Sir Philip Sidne\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Her \u0027\u0027sports\u0027\u0027 were such as carried riches of knowledge upon the stream of delight\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Hey Diddle Diddl\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The little dog laughed to see such \u0027\u0027sport\u0027\u0027, and the dish ran away with the spoon\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Mockery; derision\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Then make \u0027\u0027sport\u0027\u0027 at me; then let me be your jest\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A toy; a plaything; an object of mockery\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"flitting leaves, the \u0027\u0027sport\u0027\u0027 of every win\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"John Clark\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Never does man appear to greater disadvantage than when he is the \u0027\u0027sport\u0027\u0027 of his own ungoverned passions\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Gaming for money as in racing, hunting, fishing\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A plant or an animal, or part of a plant or animal, which has some peculiarity not usually seen in the species; an abnormal variety or growth. The term encompasses both mutants and organisms with non-genetic developmental abnormalities such as birth defects\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"date\u003d26 September passage\u003dAt Hortus Bulborum you will find heirloom narcissi that date back at least to the 15th century and famous old tulips like \u0027Duc van Tol\u0027 (1595) and its \u0027\u0027sports\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"A sportsman; a gambler\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"One who consorts with disreputable people, including prostitutes\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"An amorous dalliance\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"Charlie and Lisa enjoyed a bit of \u0027\u0027sport\u0027\u0027 after their hike\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"A friend or acquaintance \u0027(chiefly used when speaking to the friend in question\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"Play; idle jingle\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"Broom\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"An author who should introduce such a \u0027\u0027sport\u0027\u0027 of words upon our stage would meet with small applause\", \"priority\":32}]}, \"synonyms\":{}}");

	add("sporadicity", "{\"term\":\"sporadicity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being sporadic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sporange", "{\"term\":\"sporange\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|sporange|lang\u003dro}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sporangium\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1880\u0027\u0027, John Nietner, \u0027The Coffee Tree and its Enemies\u0027, page 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The most immature of the \u0027\u0027sporanges\u0027\u0027 have few or no papillae on them\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1901\u0027\u0027, Deane Bret Swingle, \u0026quot;Formation of spores in the sporanges of \u0027Rhizopus Nigricans\u0027\u0026quot;, page 2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"If this were the cause we should expect to find the layer of denser plasm at the base of the \u0027\u0027sporange\u0027\u0027 as well as on the sides and top, as we have no evidence that evaporation does not go on from the part of the \u0027\u0027sporange\u0027\u0027 just around the sporangiophore as well as from the rest of its surface\", \"priority\":5}]}, \"synonyms\":{}}");

	add("sporogenesis", "{\"term\":\"sporogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spore|alt1\u003dsporo-|genesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process by which spores are produced\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sportbike", "{\"term\":\"sportbike\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|sport|bike|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A motorcycle optimized for speed, acceleration, braking, and cornering on paved roads, typically at the expense of comfort and fuel economy\", \"priority\":1}]}, \"synonyms\":{}}");

