	add("sportiness", "{\"term\":\"sportiness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|sporty|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being sporty\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sportpony", "{\"term\":\"sportpony\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|sport|pony|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of pony in the general range of 13.2-14.2 hands that looks and moves like a small horse, capable of competing in the Olympic disciplines of jumping, dressage, and eventing, as well as in driving. \u0026lt;!--It is athletic and horse-like in appearance and ability. The term \u0026quot;Sportpony\u0026quot; is considered a type, not a particular breed of pony and therefore often have crossbred pedigrees made up of everything from Welsh to New Forest to Thoroughbred or Warmblood bloodlines.Movement is paramount to the quality of a Sportpony, and that movement should have great suspension, articulation, impulsion and elasticity--\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sportsaholic", "{\"term\":\"sportsaholic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|sports|aholic|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sports enthusiast; one who loves to watch or play sport\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sportscaster", "{\"term\":\"sportscaster\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|sports|broadcaster|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who reports sporting events on television or radio. (Primarily used in North American English\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who comments, presents, and reports sport events\", \"priority\":2}]}, \"synonyms\":{}}");

	add("sportsmanship", "{\"term\":\"sportsmanship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|sportsman|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The behaviour exhibited in playing sports, either good or bad\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The good attitude/behaviour displayed by players of a game; fairness, determination, winning or losing gracefully\", \"priority\":2}]}, \"synonyms\":{}}");

	add("sportsperson", "{\"term\":\"sportsperson\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|sports|person|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who plays sport, regardless of gender\", \"priority\":1}]}, \"synonyms\":{}}");

