	add("spouse", "{\"term\":\"spouse\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027espus\u0027 \u0027espuse\u0027 and Old french (842-ca. 1400) \u0027espos\u0027 \u0027espose\u0027 and by aphasis from Latin \u0027spōnsus\u0027 (bridegroom) \u0027spōnsa\u0027 (bride) from \u0027spondere\u0027 (to vow, to pledge) from Proto-indo-european {{m|ine-pro|*spend-}}.Cognate to \u0027espouse\u0027 \u0027spondee\u0027 \u0027sponsor\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person\u0027s husband or wife\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"People should treat their \u0027\u0027spouses\u0027\u0027 with respect\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"At last such grace I found, and means I wrought, / That I that lady to my \u0027\u0027spouse\u0027\u0027 had won\", \"priority\":4}]}, \"synonyms\":{}}");

